/*-
 * Compute "textbook" wnaf representation of a scalar.
 * NB: not constant time
 */
static void scalar_wnaf(char out[449], const unsigned char in[56]) {
    int i;
    char window, d;

    window = in[0] & (DRADIX_WNAF - 1);
    for (i = 0; i < 449; i++) {
        d = 0;
        if ((window & 1) && ((d = window & (DRADIX_WNAF - 1)) & DRADIX))
            d -= DRADIX_WNAF;
        out[i] = d;
        window = (window - d) >> 1;
        window += scalar_get_bit(in, i + 1 + RADIX) << RADIX;
    }
}

/*-
 * Simulateous scalar multiplication: interleaved "textbook" wnaf.
 * NB: not constant time
 */
static void var_smul_wnaf_two(pt_aff_t *out, const unsigned char a[56],
                              const unsigned char b[56], const pt_aff_t *P) {
    int i, d, is_neg, is_inf = 1, flipped = 0;
    char anaf[449] = {0};
    char bnaf[449] = {0};
    pt_prj_t Q;
    pt_prj_t precomp[DRADIX / 2];

    precomp_wnaf(precomp, P);
    scalar_wnaf(anaf, a);
    scalar_wnaf(bnaf, b);

    for (i = 448; i >= 0; i--) {
        if (!is_inf) point_double(&Q, &Q);
        if ((d = bnaf[i])) {
            if ((is_neg = d < 0) != flipped) {
                fiat_Wei448_opp(Q.X, Q.X);
                fiat_Wei448_opp(Q.T, Q.T);
                flipped ^= 1;
            }
            d = (is_neg) ? (-d - 1) >> 1 : (d - 1) >> 1;
            if (is_inf) {
                /* initialize accumulator */
                fe_copy(Q.X, &precomp[d].X);
                fe_copy(Q.Y, &precomp[d].Y);
                fe_copy(Q.T, &precomp[d].T);
                fe_copy(Q.Z, &precomp[d].Z);
                is_inf = 0;
            } else
                point_add_proj(&Q, &Q, &precomp[d]);
        }
        if ((d = anaf[i])) {
            if ((is_neg = d < 0) != flipped) {
                fiat_Wei448_opp(Q.X, Q.X);
                fiat_Wei448_opp(Q.T, Q.T);
                flipped ^= 1;
            }
            d = (is_neg) ? (-d - 1) >> 1 : (d - 1) >> 1;
            if (is_inf) {
                /* initialize accumulator */
                fe_copy(Q.X, &lut_cmb[0][d].X);
                fe_copy(Q.Y, &lut_cmb[0][d].Y);
                fe_copy(Q.T, &lut_cmb[0][d].T);
                fe_copy(Q.Z, const_one);
                is_inf = 0;
            } else
                point_add_mixed(&Q, &Q, &lut_cmb[0][d]);
        }
    }

    if (is_inf) {
        /* initialize accumulator to inf: all-zero scalars */
        fe_set_zero(Q.X);
        fe_copy(Q.Y, const_one);
        fe_set_zero(Q.T);
        fe_copy(Q.Z, const_one);
    }

    if (flipped) {
        /* correct sign */
        fiat_Wei448_opp(Q.X, Q.X);
        fiat_Wei448_opp(Q.T, Q.T);
    }

    /* move from Edwards projective to legacy projective */
    point_edwards2legacy(&Q, &Q);
    /* convert to affine -- NB depends on coordinate system */
    fiat_Wei448_inv(Q.Z, Q.Z);
    fiat_Wei448_carry_mul(out->X, Q.X, Q.Z);
    fiat_Wei448_carry_mul(out->Y, Q.Y, Q.Z);
}

/*-
 * Variable point scalar multiplication with "regular" wnaf.
 */
static void var_smul_rwnaf(pt_aff_t *out, const unsigned char scalar[56],
                           const pt_aff_t *P) {
    int i, j, d, diff, is_neg;
    char rnaf[90] = {0};
    pt_prj_t Q, lut;
    pt_prj_t precomp[DRADIX / 2];

    precomp_wnaf(precomp, P);
    scalar_rwnaf(rnaf, scalar);

#if defined(_MSC_VER)
    /* result still unsigned: yes we know */
#pragma warning(push)
#pragma warning(disable : 4146)
#endif

    /* initialize accumulator to high digit */
    d = (rnaf[89] - 1) >> 1;
    for (j = 0; j < DRADIX / 2; j++) {
        diff = (1 - (-(d ^ j) >> (8 * sizeof(int) - 1))) & 1;
        fiat_Wei448_selectznz(Q.X, diff, Q.X, precomp[j].X);
        fiat_Wei448_selectznz(Q.Y, diff, Q.Y, precomp[j].Y);
        fiat_Wei448_selectznz(Q.T, diff, Q.T, precomp[j].T);
        fiat_Wei448_selectznz(Q.Z, diff, Q.Z, precomp[j].Z);
    }

    for (i = 88; i >= 0; i--) {
        for (j = 0; j < RADIX; j++) point_double(&Q, &Q);
        d = rnaf[i];
        /* is_neg = (d < 0) ? 1 : 0 */
        is_neg = (d >> (8 * sizeof(int) - 1)) & 1;
        /* d = abs(d) */
        d = (d ^ -is_neg) + is_neg;
        d = (d - 1) >> 1;
        for (j = 0; j < DRADIX / 2; j++) {
            diff = (1 - (-(d ^ j) >> (8 * sizeof(int) - 1))) & 1;
            fiat_Wei448_selectznz(lut.X, diff, lut.X, precomp[j].X);
            fiat_Wei448_selectznz(lut.Y, diff, lut.Y, precomp[j].Y);
            fiat_Wei448_selectznz(lut.T, diff, lut.T, precomp[j].T);
            fiat_Wei448_selectznz(lut.Z, diff, lut.Z, precomp[j].Z);
        }
        /* negate lut point if digit is negative */
        fiat_Wei448_opp(out->X, lut.X);
        fiat_Wei448_opp(out->T, lut.T);
        fiat_Wei448_selectznz(lut.X, is_neg, lut.X, out->X);
        fiat_Wei448_selectznz(lut.T, is_neg, lut.T, out->T);
        point_add_proj(&Q, &Q, &lut);
    }

#if defined(_MSC_VER)
#pragma warning(pop)
#endif

    /* conditionally subtract P if the scalar was even */
    fiat_Wei448_opp(lut.X, precomp[0].X);
    fe_copy(lut.Y, precomp[0].Y);
    fiat_Wei448_opp(lut.T, precomp[0].T);
    fe_copy(lut.Z, precomp[0].Z);
    point_add_proj(&lut, &lut, &Q);
    fiat_Wei448_selectznz(Q.X, scalar[0] & 1, lut.X, Q.X);
    fiat_Wei448_selectznz(Q.Y, scalar[0] & 1, lut.Y, Q.Y);
    fiat_Wei448_selectznz(Q.T, scalar[0] & 1, lut.T, Q.T);
    fiat_Wei448_selectznz(Q.Z, scalar[0] & 1, lut.Z, Q.Z);

    /* move from Edwards projective to legacy projective */
    point_edwards2legacy(&Q, &Q);
    /* convert to affine -- NB depends on coordinate system */
    fiat_Wei448_inv(Q.Z, Q.Z);
    fiat_Wei448_carry_mul(out->X, Q.X, Q.Z);
    fiat_Wei448_carry_mul(out->Y, Q.Y, Q.Z);
}

/*-
 * Fixed scalar multiplication: comb with interleaving.
 */
static void fixed_smul_cmb(pt_aff_t *out, const unsigned char scalar[56]) {
    int i, j, k, d, diff, is_neg = 0;
    char rnaf[90] = {0};
    pt_prj_t Q, R;
    pt_aff_t lut;

    scalar_rwnaf(rnaf, scalar);

    /* initalize accumulator to inf */
    fe_set_zero(Q.X);
    fe_copy(Q.Y, const_one);
    fe_set_zero(Q.T);
    fe_copy(Q.Z, const_one);

#if defined(_MSC_VER)
    /* result still unsigned: yes we know */
#pragma warning(push)
#pragma warning(disable : 4146)
#endif

    for (i = 9; i >= 0; i--) {
        for (j = 0; i != 9 && j < RADIX; j++) point_double(&Q, &Q);
        for (j = 0; j < 10; j++) {
            if (j * 10 + i > 89) continue;
            d = rnaf[j * 10 + i];
            /* is_neg = (d < 0) ? 1 : 0 */
            is_neg = (d >> (8 * sizeof(int) - 1)) & 1;
            /* d = abs(d) */
            d = (d ^ -is_neg) + is_neg;
            d = (d - 1) >> 1;
            for (k = 0; k < DRADIX / 2; k++) {
                diff = (1 - (-(d ^ k) >> (8 * sizeof(int) - 1))) & 1;
                fiat_Wei448_selectznz(lut.X, diff, lut.X, lut_cmb[j][k].X);
                fiat_Wei448_selectznz(lut.Y, diff, lut.Y, lut_cmb[j][k].Y);
                fiat_Wei448_selectznz(lut.T, diff, lut.T, lut_cmb[j][k].T);
            }
            /* negate lut point if digit is negative */
            fiat_Wei448_opp(out->X, lut.X);
            fiat_Wei448_opp(out->T, lut.T);
            fiat_Wei448_selectznz(lut.X, is_neg, lut.X, out->X);
            fiat_Wei448_selectznz(lut.T, is_neg, lut.T, out->T);
            point_add_mixed(&Q, &Q, &lut);
        }
    }

#if defined(_MSC_VER)
#pragma warning(pop)
#endif

    /* conditionally subtract P if the scalar was even */
    fiat_Wei448_opp(lut.X, lut_cmb[0][0].X);
    fe_copy(lut.Y, lut_cmb[0][0].Y);
    fiat_Wei448_opp(lut.T, lut_cmb[0][0].T);
    point_add_mixed(&R, &Q, &lut);
    fiat_Wei448_selectznz(Q.X, scalar[0] & 1, R.X, Q.X);
    fiat_Wei448_selectznz(Q.Y, scalar[0] & 1, R.Y, Q.Y);
    fiat_Wei448_selectznz(Q.T, scalar[0] & 1, R.T, Q.T);
    fiat_Wei448_selectznz(Q.Z, scalar[0] & 1, R.Z, Q.Z);

    /* move from Edwards projective to legacy projective */
    point_edwards2legacy(&Q, &Q);
    /* convert to affine -- NB depends on coordinate system */
    fiat_Wei448_inv(Q.Z, Q.Z);
    fiat_Wei448_carry_mul(out->X, Q.X, Q.Z);
    fiat_Wei448_carry_mul(out->Y, Q.Y, Q.Z);
}

static void point_mul_two(unsigned char outx[56], unsigned char outy[56],
                          const unsigned char a[56], const unsigned char b[56],
                          const unsigned char inx[56],
                          const unsigned char iny[56]) {
    pt_aff_t P;

    fiat_Wei448_from_bytes(P.X, inx);
    fiat_Wei448_from_bytes(P.Y, iny);
    /* simultaneous scalar multiplication */
    var_smul_wnaf_two(&P, a, b, &P);

    fiat_Wei448_to_bytes(outx, P.X);
    fiat_Wei448_to_bytes(outy, P.Y);
}

static void point_mul_g(unsigned char outx[56], unsigned char outy[56],
                        const unsigned char scalar[56]) {
    pt_aff_t P;

    /* fixed scmul function */
    fixed_smul_cmb(&P, scalar);
    fiat_Wei448_to_bytes(outx, P.X);
    fiat_Wei448_to_bytes(outy, P.Y);
}

static void point_mul(unsigned char outx[56], unsigned char outy[56],
                      const unsigned char scalar[56],
                      const unsigned char inx[56],
                      const unsigned char iny[56]) {
    pt_aff_t P;

    fiat_Wei448_from_bytes(P.X, inx);
    fiat_Wei448_from_bytes(P.Y, iny);
    /* var scmul function */
    var_smul_rwnaf(&P, scalar, &P);
    fiat_Wei448_to_bytes(outx, P.X);
    fiat_Wei448_to_bytes(outy, P.Y);
}

#include <openssl/ec.h>

static const unsigned char const_zb[56] = {0};

static
    int
    point_mul_two_Wei448(const EC_GROUP *group, EC_POINT *r, const BIGNUM *n,
                         const EC_POINT *q, const BIGNUM *m, BN_CTX *ctx) {
    int ret = 0;
    unsigned char b_x[56];
    unsigned char b_y[56];
    unsigned char b_n[56];
    unsigned char b_m[56];
    BIGNUM *x = NULL, *y = NULL;

    BN_CTX_start(ctx);
    x = BN_CTX_get(ctx);
    if ((y = BN_CTX_get(ctx)) == NULL
        /* pull out coords as bytes */
        || !EC_POINT_get_affine_coordinates(group, q, x, y, ctx) ||
        BN_bn2lebinpad(x, b_x, 56) != 56 || BN_bn2lebinpad(y, b_y, 56) != 56 ||
        BN_bn2lebinpad(n, b_n, 56) != 56 || BN_bn2lebinpad(m, b_m, 56) != 56)
        goto err;
    /* do the simultaneous scalar multiplication */
    point_mul_two(b_x, b_y, b_n, b_m, b_x, b_y);
    /* check for infinity */
    if (CRYPTO_memcmp(const_zb, b_x, 56) == 0 &&
        CRYPTO_memcmp(const_zb, b_y, 56) == 0) {
        if (!EC_POINT_set_to_infinity(group, r)) goto err;
    } else {
        /* otherwise, pack the bytes into the result */
        if (BN_lebin2bn(b_x, 56, x) == NULL ||
            BN_lebin2bn(b_y, 56, y) == NULL ||
            !EC_POINT_set_affine_coordinates(group, r, x, y, ctx))
            goto err;
    }
    ret = 1;
err:
    BN_CTX_end(ctx);
    return ret;
}

static
    int
    point_mul_Wei448(const EC_GROUP *group, EC_POINT *r, const EC_POINT *q,
                     const BIGNUM *m, BN_CTX *ctx) {
    int ret = 0;
    unsigned char b_x[56];
    unsigned char b_y[56];
    unsigned char b_m[56];
    BIGNUM *x = NULL, *y = NULL;

    BN_CTX_start(ctx);
    x = BN_CTX_get(ctx);
    if ((y = BN_CTX_get(ctx)) == NULL
        /* pull out coords as bytes */
        || !EC_POINT_get_affine_coordinates(group, q, x, y, ctx) ||
        BN_bn2lebinpad(x, b_x, 56) != 56 || BN_bn2lebinpad(y, b_y, 56) != 56 ||
        BN_bn2lebinpad(m, b_m, 56) != 56)
        goto err;
    /* do the variable scalar multiplication */
    point_mul(b_x, b_y, b_m, b_x, b_y);
    /* check for infinity */
    if (CRYPTO_memcmp(const_zb, b_x, 56) == 0 &&
        CRYPTO_memcmp(const_zb, b_y, 56) == 0) {
        if (!EC_POINT_set_to_infinity(group, r)) goto err;
    } else {
        /* otherwise, pack the bytes into the result */
        if (BN_lebin2bn(b_x, 56, x) == NULL ||
            BN_lebin2bn(b_y, 56, y) == NULL ||
            !EC_POINT_set_affine_coordinates(group, r, x, y, ctx))
            goto err;
    }
    ret = 1;
err:
    BN_CTX_end(ctx);
    return ret;
}

static
    int
    point_mul_g_Wei448(const EC_GROUP *group, EC_POINT *r, const BIGNUM *n,
                       BN_CTX *ctx) {
    int ret = 0;
    unsigned char b_x[56];
    unsigned char b_y[56];
    unsigned char b_n[56];
    BIGNUM *x = NULL, *y = NULL;

    BN_CTX_start(ctx);
    x = BN_CTX_get(ctx);
    if ((y = BN_CTX_get(ctx)) == NULL || BN_bn2lebinpad(n, b_n, 56) != 56)
        goto err;
    /* do the fixed scalar multiplication */
    point_mul_g(b_x, b_y, b_n);
    /* check for infinity */
    if (CRYPTO_memcmp(const_zb, b_x, 56) == 0 &&
        CRYPTO_memcmp(const_zb, b_y, 56) == 0) {
        if (!EC_POINT_set_to_infinity(group, r)) goto err;
    } else {
        /* otherwise, pack the bytes into the result */
        if (BN_lebin2bn(b_x, 56, x) == NULL ||
            BN_lebin2bn(b_y, 56, y) == NULL ||
            !EC_POINT_set_affine_coordinates(group, r, x, y, ctx))
            goto err;
    }
    ret = 1;
err:
    BN_CTX_end(ctx);
    return ret;
}

#include "ec_local.h"

static int ec_GFp_mul_Wei448(const EC_GROUP *group, EC_POINT *r,
                             const BIGNUM *scalar, size_t num,
                             const EC_POINT **points, const BIGNUM **scalars,
                             BN_CTX *ctx) {
    if (group == NULL || r == NULL || ctx == NULL)
        return ec_wNAF_mul(group, r, scalar, num, points, scalars, ctx);

    if (scalar != NULL && num == 1 && scalars != NULL && scalars[0] != NULL &&
        points != NULL && points[0] != NULL) {
        /* verification */
        if (BN_num_bits(scalar) > EC_GROUP_order_bits(group) ||
            BN_is_negative(scalar) ||
            BN_num_bits(scalars[0]) > EC_GROUP_order_bits(group) ||
            BN_is_negative(scalars[0]))
            return ec_wNAF_mul(group, r, scalar, num, points, scalars, ctx);
        return point_mul_two_Wei448(group, r, scalar, points[0], scalars[0],
                                    ctx);
    } else if (scalar != NULL && num == 0) {
        /* mul g */
        if (BN_num_bits(scalar) > EC_GROUP_order_bits(group) ||
            BN_is_negative(scalar))
            return ec_wNAF_mul(group, r, scalar, num, points, scalars, ctx);
        return point_mul_g_Wei448(group, r, scalar, ctx);
    } else if (scalar == NULL && num == 1 && scalars[0] != NULL &&
               points != NULL && points[0] != NULL) {
        /* mul */
        if (BN_num_bits(scalars[0]) > EC_GROUP_order_bits(group) ||
            BN_is_negative(scalars[0]))
            return ec_wNAF_mul(group, r, scalar, num, points, scalars, ctx);
        return point_mul_Wei448(group, r, points[0], scalars[0], ctx);
    }
    return ec_wNAF_mul(group, r, scalar, num, points, scalars, ctx);
}

